import styled from "styled-components";

const ContenedorProducto = styled.div`
    border: 3px solid #ddd;
    width: 100%;
    padding: 20px;
    max-height: 10%;
    border-radius: 5px;
    display: flex;
    flex-direction: column;
    justify-content: space-between;
    align-items: center;
    gap: 10px;`

export default ContenedorProducto;
